import React from 'react';

function Footer() {
    return (
        <footer className="bg-gray-800 text-white p-4 mt-8">
            <p className="text-center">&copy; 2024 Barcode Generator. All rights reserved.</p>
        </footer>
    );
}

export default Footer;
